import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Hero from './components/Hero';
import Navbar from './components/Navbar';
import FormP from './views/FormBand';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path="/" element={<Hero />} default/>

          {/* Band Routes */}
          <Route path="/band/new" element={<FormBand />}/>
          <Route path="/band/:id" element={<BandDisplay />}/>


        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
